/*Table structure for table `food` */

DROP TABLE IF EXISTS `food`;

CREATE TABLE `food` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `cat_id` int(11) NOT NULL DEFAULT '0' COMMENT '分类id',
  `name` varchar(100) NOT NULL DEFAULT '' COMMENT '书籍名称',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '售卖金额',
  `main_image` varchar(100) NOT NULL DEFAULT '' COMMENT '主图',
  `summary` varchar(10000) NOT NULL DEFAULT '' COMMENT '描述',
  `stock` int(11) NOT NULL DEFAULT '0' COMMENT '库存量',
  `tags` varchar(200) NOT NULL DEFAULT '' COMMENT 'tag关键字，以","连接',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态 1：有效 0：无效',
  `month_count` int(11) NOT NULL DEFAULT '0' COMMENT '月销售数量',
  `total_count` int(11) NOT NULL DEFAULT '0' COMMENT '总销售量',
  `view_count` int(11) NOT NULL DEFAULT '0' COMMENT '总浏览次数',
  `comment_count` int(11) NOT NULL DEFAULT '0' COMMENT '总评论量',
  `updated_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `created_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '最后插入时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 COMMENT='食品表';

/*Data for the table `food` */

insert  into `food`(`id`,`cat_id`,`name`,`price`,`main_image`,`summary`,`stock`,`tags`,`status`,`month_count`,`total_count`,`view_count`,`comment_count`,`updated_time`,`created_time`) values (1,2,'鱼香肉丝','10.00','20200505/7d6b640108b047a1997616ebebdbc916.jpg','<p>鱼香肉丝是川菜中的一道名品，主要是用鲫鱼腌制的泡辣椒炒制猪里脊肉丝而成，以此将肉丝炒出鱼香味，故而叫鱼香肉丝。</p>',50,'辣,酸,甜',1,0,0,0,0,'2020-05-05 08:46:34','2020-05-05 08:46:34'),(2,2,'水煮肉片','15.00','20200505/68c608acf57a42d19d6b9814e454bf1a.jpg','<p>水煮肉片是一道地方新创名菜，起源于自贡，发扬于西南，属于川菜中著名的家常菜。因肉片未经划油，以水煮熟故名水煮肉片。</p>',50,'麻辣,鲜香',1,0,0,0,0,'2020-05-05 08:48:37','2020-05-05 08:48:37'),(3,1,'农家小炒肉','10.00','20200505/19c25a1b46054ad2828b02f31ddebb6c.jpg','<p>小炒肉是湖南省一道常见的特色传统名菜，属于湘菜系。麻辣鲜香，口味滑嫩。制作原料主要是五花肉和青椒、红椒等。</p>',97,'咸,辣',1,0,0,0,0,'2020-05-15 15:36:45','2020-05-05 08:50:37'),(4,1,'剁椒鱼头','20.00','20200505/9fb52ddd5b4746038394fe743fce5cce.jpg','<p>剁椒鱼头是湖南省的传统名菜，属于湘菜系。通常以鳙鱼鱼头、剁椒为主料，配以豉油、姜、葱、蒜等辅料蒸制而成。菜品色泽红亮、味浓、肉质细嫩。肥而不腻、口感软糯、鲜辣适口。</p>',30,'咸鲜,微辣',1,0,0,0,0,'2020-05-05 08:53:03','2020-05-05 08:53:03'),(5,3,'白切鸡','10.00','20200505/4bb33aca1e4d4935ac03fda7ee2ab409.jpg','<p>白切鸡又叫白斩鸡，是中国八大菜之一粤菜系鸡肴中的一种，始于清代的民间酒店。</p><p>白切鸡通常选用细骨农家鸡与沙姜、蒜茸等食材，慢火煮浸后，晾干切块。</p><p>成菜后，色洁白带油黄，皮爽肉滑骨香，清淡鲜美。</p><p><br/></p>',40,'清淡,鲜美',1,0,0,0,0,'2020-05-05 08:55:40','2020-05-05 08:55:40'),(6,3,'木瓜炖雪蛤','20.00','20200505/433d50e061f54c469083ade89205f2b1.jpg','<p>木瓜炖雪蛤是一道美味可口的传统名点，属于粤菜系。以木瓜和雪蛤为主要食材，属粤式甜品，润肤养颜，营养价值丰富。主要材料有木瓜、雪蛤油、鲜奶、水等。</p>',25,'甜',1,0,0,0,0,'2020-05-05 08:57:31','2020-05-05 08:57:31'),(7,4,'飞龙汤','15.00','20200505/fe26d84de2a84c1fa286924fcc1297dc.jpg','<p>飞龙又名榛鸡是黑龙江省的名菜之一，属于龙江菜系，产于兴安岭。飞龙汤是将榛鸡脱毛去掉内脏后，用高汤煮熟即可，汤中不需放任何调料以保持汤原汁原味。飞龙汤肉质鲜美，营养丰富，适合用作滋补汤品。</p>',35,'营养丰富,汤肉质鲜美',1,0,0,0,0,'2020-05-05 08:59:53','2020-05-05 08:59:53'),(8,5,'糖醋鲤鱼','15.00','20200515/620858717a704b5d8bfb950f5036a68a.jpg','<p>店长推荐<br/></p>',50,'酸甜',1,0,0,0,0,'2020-05-15 16:30:26','2020-05-15 16:30:26');

/*Table structure for table `food_cat` */

DROP TABLE IF EXISTS `food_cat`;

CREATE TABLE `food_cat` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '类别名称',
  `weight` tinyint(4) NOT NULL DEFAULT '1' COMMENT '权重',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态 1：有效 0：无效',
  `updated_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '最后一次更新时间',
  `created_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '插入时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_name` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COMMENT='食品分类';

